import React from 'react';

import Item from './item';

const column = (props) => {

    const {column, tasks} = props;

    return (
        <div>
            <h1>{column.title}</h1>
            {tasks.map(task => <Item key={task.id} content={task.content}/>)}
        </div>
    );
}

export default column;
